import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'cinebook_app';
}
<nav class="navbar">
  <div class="brand">
    <h1>Cinebook</h1>
  </div>
  <div class="nav-links">
    <a routerLink="/home">Home</a>
    <a routerLink="/movies">Movies</a>
  </div>
</nav>

<router-outlet></router-outlet>
